import React from 'react';

function TodoList({ todos, onDelete, onToggleComplete }) {
  return (
    <ul className="space-y-2">
      {todos.map(todo => (
        <li 
          key={todo._id} 
          className={`flex items-center justify-between p-3 rounded-lg shadow-md transition-all duration-300 ${
            todo.completed ? 'bg-green-100 line-through text-gray-500' : 'bg-white hover:bg-gray-50'
          }`}
        >
          <span 
            onClick={() => onToggleComplete(todo._id)}
            className="flex-grow cursor-pointer"
          >
            {todo.text}
          </span>
          <button 
            onClick={() => onDelete(todo._id)}
            className="ml-4 bg-red-500 text-white px-3 py-1 rounded-full hover:bg-red-600 transition-colors"
          >
            Delete
          </button>
        </li>
      ))}
    </ul>
  );
}

export default TodoList;
